import { MDBCarousel, MDBCarouselItem } from 'mdb-react-ui-kit';
import "./LandingPage.css"
export default function ImageSlider() {
    let greet = 'Welcome to';
    let greetMessage = 'Your Premier E-Wedding Destination';
    function ShowGreet() {
        return <div className="greeting-message">
            <span className="greet-title">{greet}</span>
            <span className="greet-message">{greetMessage}</span>
        </div>
    }
    return (
        // <MDBCarousel fade interval={2000}>
        //     <MDBCarouselItem className='d-block w-100' itemId={1} src='assets/wedding-image1.jpg' alt='image 1'>
        //         {ShowGreet()}
        //     </MDBCarouselItem>
        //     <MDBCarouselItem className='d-block w-100' itemId={2} src='assets/wedding-image2.jpg' alt='image 2'>
        //         {ShowGreet()}
        //     </MDBCarouselItem>
        //     <MDBCarouselItem className='d-block w-100' itemId={3} src='assets/wedding-image3.jpg' alt='image 3'>
        //         {ShowGreet()}
        //     </MDBCarouselItem>
        // </MDBCarousel>
        <MDBCarousel dark={true} fade interval={2000}>
      <MDBCarouselItem itemId={1}>
        <img src='assets/wedding-image1.jpg' className='w-100 d-block' alt='Image1' />
        {ShowGreet()}
      </MDBCarouselItem>
      <MDBCarouselItem itemId={2}>
        <img src='assets/wedding-image2.jpg' className='w-100 d-block' alt='Image2' />
      </MDBCarouselItem>
      <MDBCarouselItem itemId={3}>
        <img src='assets/wedding-image3.jpg' className='w-100 d-block' alt='Image3' />
      </MDBCarouselItem>
    </MDBCarousel>
    )
}
